    aequasi_cache.array:
        class: %aequasi_cache.array.class%
        abstract: true
    aequasi_cache.file_system:
        class: %aequasi_cache.file_system.class%
        abstract: true
    aequasi_cache.memcache:
        class: %aequasi_cache.memcache.class%
        abstract: true
    aequasi_cache.memcached:
        class: %aequasi_cache.memcached.class%
        abstract: true
    aequasi_cache.redis:
        class: %aequasi_cache.redis.class%
        abstract: true
    aequasi_cache.php_file:
        class: %aequasi_cache.php_file.class%
        abstract: true
    aequasi_cache.win_cache:
        class: %aequasi_cache.win_cache.class%
        abstract: true
    aequasi_cache.xcache:
        class: %aequasi_cache.xcache.class%
        abstract: true
    aequasi_cache.zend_data:
        class: %aequasi_cache.zend_data.class%
        abstract: true